import React from "react";
import {
  Container,
  Row,
  Col,
  Form,
  Button,
  Card,
  InputGroup,
  DropdownButton,
  Dropdown,
} from "react-bootstrap";

const results = [
  {
    id: 1,
    name: "Product 1",
    description: "Description of Product 1",
    rating: 4,
    store: "Store 1",
    distance: 1.2,
    location: "Location 1",
    image: "https://via.placeholder.com/150",
    price: 10.99,
  },
  {
    id: 2,
    name: "Product 2",
    description: "Description of Product 2",
    rating: 3,
    store: "Store 2",
    distance: 2.5,
    location: "Location 2",
    image: "https://via.placeholder.com/150",
    price: 20.99,
  },
  {
    id: 3,
    name: "Product 3",
    description: "Description of Product 3",
    rating: 5,
    store: "Store 3",
    distance: 3.7,
    location: "Location 3",
    image: "https://via.placeholder.com/150",
    price: 15.99,
  },
];

const SearchResult = () => {
  //   const ProductCard = ({ product }) => (
  //     <Card className="h-100">
  //       <Row>
  //         <Col xs={6}>
  //           <Card.Img variant="top" src={product.image} />
  //         </Col>
  //         <Col xs={6}>
  //           <Card.Body>
  //             <Card.Title>{product.name}</Card.Title>
  //             <Card.Text>{product.description}</Card.Text>
  //             <Card.Text>{product.rating} stars</Card.Text>
  //             <Card.Text>{product.store}</Card.Text>
  //             <Card.Text>{product.distance} miles from your location</Card.Text>
  //             <Card.Text>{product.location}</Card.Text>
  //             <Card.Text>${product.price}</Card.Text>
  //           </Card.Body>
  //         </Col>
  //       </Row>
  //     </Card>
  //   );
  const ProductCard = ({ product }) => (
    <Card className="h-100">
      <Row>
        <Col xs={5}>
          <Card.Img
            variant="top"
            src={product.image}
            style={{ width: "100%" }}
          />
        </Col>
        <Col xs={7}>
          <Card.Body>
            <Card.Title>{product.name}</Card.Title>
            <Card.Text>{product.description}</Card.Text>
            <Card.Text>{product.rating} stars</Card.Text>
            <Card.Text>{product.store}</Card.Text>
            <Card.Text>{product.distance} miles from your location</Card.Text>
            <Card.Text>{product.location}</Card.Text>
            <Card.Text>${product.price}</Card.Text>
          </Card.Body>
        </Col>
      </Row>
    </Card>
  );

  return (
    <Container>
      <Row className="my-4 py-5">
        <Col className="d-flex justify-content-center">
          <InputGroup>
            <Form.Control
              style={{ height: "50px", fontWeight: "bold" }}
              type="search"
              placeholder="Search"
            />
            <DropdownButton
              variant="outline-secondary"
              title="Options"
              id="input-group-dropdown-1"
            >
              <Dropdown.Item href="#">Distance</Dropdown.Item>
              <Dropdown.Item href="#">Price</Dropdown.Item>
            </DropdownButton>
            <Button variant="primary">
              <i className="fas fa-search"></i>
            </Button>
          </InputGroup>
        </Col>
      </Row>
      <Row>
        <Col>
          <h5>Search Results</h5>
        </Col>
      </Row>
      {results.map((result) => (
        <Row key={result.id} className="pb-4">
          <Col>
            <ProductCard product={result} />
          </Col>
        </Row>
      ))}
    </Container>
  );
};

export default SearchResult;
